window.bookSummaryJSON = "<p><b>The Expeditionary Force saga continues with </b><b><i>Fallout</i></b><b>, the eagerly awaited sequel to number one Audible-ranked and </b><b><i>New York Times</i></b><b> best-selling </b><b><i>Breakaway</i></b><b>, from an epic sci-fi writer at the top of his game. Join the millions of listeners who have enjoyed R.C. Brayâ€™s hilarious portrayal of Joe, Skippy, the Merry Band of Pirates, and so many other unforgettable characters. </b></p> <p>The problem with lying about having a super weapon is that the bad guys might believe they have nothing to lose by doing something stupid that both sides will regret.&nbsp;Or, they might just call your bluff.&nbsp;Either way, the Merry Band of Pirates need a plan to deal with the Fallout.</p>"; 
